import { InputHTMLAttributes } from "react";
import { StyledInputs } from "./style";
interface IInputProps extends InputHTMLAttributes<HTMLInputElement> {
  name: string;
}
export const Inputs: React.FC<IInputProps> = ({ props, text }) => {
  return (
    <>
      <StyledInputs>
        <input {...props} />
        <label>{text}</label>
        {/* <p>Email invalido</p> */}
      </StyledInputs>
    </>
  );
};
